import React from "react";

function Time(){
var ctime = new Date();
ctime = ctime.getHours();
var greet;
let cstyle = {
  color: "",
  fontSize: 35,
};
if (ctime <= 12) {
  greet = "Good morning";
  cstyle.color = "red";
} else if (ctime <= 18) {
  greet = "Good Afternoon";
  cstyle.color = "green";
} else {
  greet = "Good Night";
  cstyle.color = "blue";
}
return 
<div>
    <h1 className="time">Time is {ctime}</h1>
    <p style={cstyle}>{greet}</p>
  </div>
}

export default Time;
